import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

import Navbar from './omponents/Navbar';
import Logout from './components/Logout';

// Pages Auth
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';

// Pages Home
import Accueil from './pages/Home/Accueil';
import Home from './pages/Home/Home';

// Dashboards
import DashboardAdmin from './pages/Dashboard/DashboardAdmin';
import DashboardEntreprise from './pages/Dashboard/DashboardEntreprise';
import DashboardMinistere from './pages/Dashboard/DashboardMinistere';

// Offres
import DetailOffre from './pages/Offre/DetailOffre';
import Postuler from './Pages/Offre/Postuler';
import Candidature from './pages/Offre/Candidature'; // ou MesCandidatures si tu l’as renommé

function App() {
  return (
    <BrowserRouter>
      <Navbar /> {/* Apparaît sur toutes les pages */}

      <Routes>
        {/* Accueil et Authentification */}
        <Route path="/" element={<Home />} />
        <Route path="/accueil" element={<Accueil />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Dashboards */}
        <Route path="/dashboard/admin" element={<DashboardAdmin />} />
        <Route path="/dashboard/ministere" element={<DashboardMinistere />} />
        <Route path="/dashboard/entreprise" element={<DashboardEntreprise />} />

        {/* Offres */}
        <Route path="/offre/:id" element={<DetailOffre />} />
        <Route path="/postuler/:id" element={<Postuler />} />
        <Route path="/mes-candidatures" element={<Candidature />} />

        {/* Déconnexion */}
        <Route path="/logout" element={<Logout />} />

        {/* Redirection en cas de route inconnue */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
